import React from 'react'

const Pods = ({ pods }) => {
  return (
    <div>
      <center><h1>Pod List</h1></center>
      <center><h3>PODS 0</h3></center>
      <p>{pods[0]}</p>
      <center><h3>PODS</h3></center>
      <p>{pods}</p>
      <center><h3>map</h3></center>
      {pods.map((pod) => (
          <div>
            <h5>{pod}</h5>
        </div>
      ))}
      {pods.map((pod) => (
          <div>
            <h5>{pod.Name}</h5>
            <h6>{pod.Namespace}</h6>
        </div>
      ))}
    </div>
  )
};

export default Pods
